export default {
  name: "Footer",

  components: {
    CardAuthor: () =>
      import(/* webpackChunkName = "CardAuthor" */ "@theme/components/CardAuthor"),
    Newsletter: () =>
      import(/* webpackChunkName = "Newsletter" */ "@theme/components/Newsletter"),
    LazyLoad: () =>
      import(/* webpackChunkName = "LazyLoad" */ "@theme/components/lazy/load")
  },

  computed: {
    getAuthor() {
      return this.$authors.filter(author => {
        return author.frontmatter.lang === this.$localeConfig.lang;
      });
    }
  }
};
